import React, { useState } from "react";
import { ShoppingCart, Pill, Plus, Minus, Search, Calendar, BoxSelect, Package } from "lucide-react";

export function ProductList({ products, onAddToCart }) {
  const [quantities, setQuantities] = useState(
    products.reduce((acc, product) => {
      acc[product._id] = 1;
      return acc;
    }, {})
  );

  const handleQuantityChange = (id, change) => {
    setQuantities(prev => {
      const newValue = Math.max(1, (prev[id] || 1) + change);
      return { ...prev, [id]: newValue };
    });
  };

  const addToCart = (product) => {
    onAddToCart({
      ...product,
      quantity: quantities[product._id]
    });
  };

  return (
    <div className="product-list">
      <div className="product-list-header">
        <h2>Available Medicines</h2>
        <div className="product-list-search">
          <Search size={18} className="product-list-search-icon" />
          <input
            type="text"
            placeholder="Search medicines..."
            className="product-list-search-input"
          />
        </div>
      </div>
      {products.length === 0 ? (
        <div className="product-list-empty">
          <Pill size={64} />
          <h3>No Medicines Available</h3>
          <p>Add some medicines to get started with your inventory.</p>
        </div>
      ) : (
        <div className="product-list-grid">
          {products.map((product) => (
            <div key={product._id} className="product-card">
              <div className="product-card-header">
                <span className="product-card-category">{product.category || "General"}</span>
                {product.stock < 10 && <span className="product-card-lowstock">Low Stock</span>}
              </div>
              <div className="product-card-icon">
                <Pill size={32} />
              </div>
              <div className="product-card-body">
                <h3>{product.name}</h3>
                <div className="product-card-price">Rs. {product.price}</div>
                <div className="product-card-info">
                  <div><Package size={14} /> Stock: {product.stock}</div>
                  <div><Calendar size={14} /> Exp: {product.expiry}</div>
                  <div><BoxSelect size={14} /> {product.manufacturer || "Not specified"}</div>
                </div>
                <div className="product-card-controls">
                  <div className="product-card-qty">
                    <button onClick={() => handleQuantityChange(product._id, -1)}>
                      <Minus size={16} />
                    </button>
                    <span>{quantities[product._id] || 1}</span>
                    <button onClick={() => handleQuantityChange(product._id, 1)}>
                      <Plus size={16} />
                    </button>
                  </div>
                  <button className="product-card-add" onClick={() => addToCart(product)}>
                    <ShoppingCart size={16} />
                    Add
                  </button>
                </div>
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
}
